	private static int func(int[][] map, int row, int col) {
		int answer = col;
		
		if(row==0)
			return answer;
		
		int[][] copy_map = map;
		copy_map[row][col] = 0;	//	이미 지나온 길 제거
		
		if(col-1>=0 && map[row][col-1]==1) {
			// 왼쪽에 길있으면
			answer = func(copy_map, row, col-1);
		}else if(col+1<100 && map[row][col+1]==1) {
			// 오른쪽에 길있으면
			answer = func(copy_map, row, col+1);
		}else {
			// 위쪽이겠지
			answer = func(copy_map, row-1, col);
		}
		
		return answer;
	}
	
